// SPDX-License-Identifier: MIT

pragma solidity ^0.8.7;

import "@openzeppelin/contracts/security/ReentrancyGuard.sol";

contract Futures is ReentrancyGuard {
    address payable public escAcc;
    address payable public  buyer;
    address payable public  farmer;
    uint256 public escBal;
    uint256 public escFee;
    uint256 public escAvailBal;
    uint256 public totalContracts = 0;
    uint256 public totalComplete = 0;
    uint256 public totalTerminated = 0;

    mapping(bytes32 => BuyerStruct) private buyers;
    mapping(bytes32 => FarmerStruct) private farmers;
    mapping(bytes32 => CropContractStruct) private cropContracts;
    mapping(address => CropContractStruct[]) private cropContractsOf;
    mapping(address =>  mapping(uint256 => bool)) public  accepted;
    mapping(bytes32 => address) public ownerOf;
    mapping(uint256 => Available) public isAvailable;

    enum Status {
        CREATED,
         BUYER_ACCEPTED,
         SELLER_DEPOSITED,
         BUYER_DEPOSITED,
         COMPLETED,
         TERMINATED,
         REVERTED,
         WITHDRAWN
    }

    enum Available{NO, YES}

    struct FarmerStruct {
        bytes32 id;
        string name;
        string email;
        string phoneNumber;
        string cropTypes;
        string location;
        uint256 timestamp;
    }


     struct BuyerStruct {
        bytes32 id;
        string name;
        uint256 phoneNo;
        string email;
        string businessName;
        string location;
        uint256 timestamp;
     }

    struct CropContractStruct {
        bytes32 id;
        string product;
        uint256 quantity;
        string unit;
        string expectedMonthOfDelivery;
        uint256 pricePerUnit;
        string termsAndConditions;
        address owner;
        address buyer;
        Status  status;
        bool accepted;
    }

    event Action(
        bytes32 id,
        string actionType,
        Status status,
        address indexed  executor
    );

    constructor () {
        escAcc = payable (msg.sender);
        escBal = 0;
        escAvailBal = 0;
        // escFee = _escFee;
    }

    function createBuyer(
    string memory _name,
    uint256 _phoneNo,
    string memory _email,
    string memory _businessName,
    string memory _location
) external {
    require(
        bytes(_name).length > 0 &&
        _phoneNo > 0 &&
        bytes(_businessName).length > 0 &&
        bytes(_location).length > 0,
        "Invalid input"
    );

    bytes32 buyerId = keccak256(abi.encodePacked(msg.sender, block.timestamp));
    BuyerStruct memory newBuyer = BuyerStruct({
        id: buyerId,
        name: _name,
        phoneNo: _phoneNo,
        email: _email,
        businessName: _businessName,
        location: _location,
        timestamp: block.timestamp
    });

    buyers[buyerId] = newBuyer;
    ownerOf[buyerId] = msg.sender;

    emit Action(
        buyerId,
        "BUYER_CREATED",
        Status.CREATED,
        msg.sender
    );
}

function createFarmer(
    string memory _name,
    string memory _email,
    string memory _phoneNumber,
    string memory _cropTypes,
    string memory _location
) external {
    require(
        bytes(_name).length > 0 &&
        bytes(_phoneNumber).length > 0 &&
        bytes(_cropTypes).length > 0 &&
        bytes(_location).length > 0,
        "Invalid input"
    );

    bytes32 farmerId = keccak256(abi.encodePacked(msg.sender, block.timestamp));
    FarmerStruct memory newFarmer = FarmerStruct({
        id: farmerId,
        name: _name,
        email: _email,
        phoneNumber: _phoneNumber,
        cropTypes: _cropTypes,
        location: _location,
        timestamp: block.timestamp
    });

    farmers[farmerId] = newFarmer;
    ownerOf[farmerId] = msg.sender;

    emit Action(
        farmerId,
        "FARMER_CREATED",
        Status.CREATED,
        msg.sender
    );
}

function createCropContract(
    string memory _product,
    uint256 _quantity,
    string memory _unit,
    string memory _expectedMonthOfDelivery,
    uint256 _pricePerUnit,
    string memory _termsAndConditions
) external {
    require(
        bytes(_product).length > 0 &&
        _quantity > 0 &&
        bytes(_unit).length > 0 &&
        bytes(_expectedMonthOfDelivery).length > 0 &&
        _pricePerUnit > 0 &&
        bytes(_termsAndConditions).length > 0,
        "Invalid input"
    );

    bytes32 contractId = keccak256(abi.encodePacked(msg.sender, block.timestamp));
    CropContractStruct memory newContract = CropContractStruct({
        id: contractId,
        product: _product,
        quantity: _quantity,
        unit: _unit,
        expectedMonthOfDelivery: _expectedMonthOfDelivery,
        pricePerUnit: _pricePerUnit,
        termsAndConditions: _termsAndConditions,
        owner: msg.sender,
        buyer: address(0), //Initialize buyer as address(0)
        status: Status.CREATED,
        accepted: false
    });

    cropContracts[contractId] = newContract;
    cropContractsOf[msg.sender].push(newContract);
    ownerOf[contractId] = msg.sender;

    emit Action(
        contractId,
        "CONTRACT_CREATED",
        Status.CREATED,
        msg.sender
    );
}

function getMyContracts() external view returns (CropContractStruct[] memory) {
    return cropContractsOf[msg.sender];
}

function getAllContracts() external view returns (CropContractStruct[] memory) {
    CropContractStruct[] memory allContracts = new CropContractStruct[](totalContracts);
    for (uint256 i = 0; i < totalContracts; i++) {
        bytes32 contractId = keccak256(abi.encodePacked(i));
        allContracts[i] = cropContracts[contractId];
    }
    return allContracts;
}

function acceptContract(bytes32 _contractId) external payable {
    require(msg.value > 0, "Deposit amount must be greater than 0");
    require(cropContracts[_contractId].status == Status.CREATED, "Contract is not in the CREATED status");
    // require(cropContracts[_contractId].buyer == msg.sender, "Only the buyer can accept the contract");

    cropContracts[_contractId].status = Status.BUYER_ACCEPTED;
    cropContracts[_contractId].accepted = true;
    cropContracts[_contractId].buyer = msg.sender;  //set the buyer to the caller

    // Transfer the deposited amount to the escrow account
    escBal += msg.value;

    // Emit an event to indicate the contract acceptance
    emit Action(
        _contractId,
        "CONTRACT_ACCEPTED",
        Status.BUYER_ACCEPTED,
        msg.sender
    );
}
//1,000,000,000,000,000,000

}

